import React from 'react';

import { SearchIcon } from 'components';
import SearchWrapper, { SearchBoxWrapper } from './SearchBox.style';
import InputSearch from './Input';

const SearchBox = ({
  buttonText,
  buttonIcon,
  inputStyle,
  style,
  bordered,
  hideType,
  showSvg,
  autoSuggestion,
  className,
  value,
  expand,
}) => {
  return (
    <SearchWrapper
      className={className}
      style={style}
      autoSuggestion={autoSuggestion}
      hideType={hideType}
      expand={expand}
    >
      <SearchBoxWrapper>
        <InputSearch
          type='text'
          value={value}
          buttonIcon={buttonIcon}
          buttonText={buttonText}
          style={inputStyle}
          bordered={bordered}
          showSvg={showSvg}
        />
      </SearchBoxWrapper>
    </SearchWrapper>
  );
};

SearchBox.defaultProps = {
  bordered: false,
  autoSuggestion: false,
  buttonText: 'Search',
  buttonIcon: <SearchIcon />,
  inputStyle: {
    width: '100%',
  },
};

export { SearchBox };
